import styled from 'styled-components';
import './App.css';
import Header from './components/Header';

const ContainerApp = styled.div`
  width: 100vw;
  height: 100vh;
  background: linear-gradient(90deg, #002f52 35%, #0c75c6 100%);

  li {
    list-style: none;
  }
`

function App() {
  return (
    <ContainerApp>
      <Header/>
    </ContainerApp>
  );
}

export default App;
